-- for PostgreSQL 9
SET client_encoding = 'UTF8';

CREATE TABLE "Order" (
    "OID" bigint NOT NULL,
    "SID" bigint,
    "CID" integer,
    "Comment" text
);




ALTER TABLE ONLY "Order"
    ADD CONSTRAINT "Order_pkey" PRIMARY KEY ("OID");

ALTER TABLE ONLY "Order"
    ADD CONSTRAINT "Order_CID_fkey" FOREIGN KEY ("CID") REFERENCES "Customer"("CID");

ALTER TABLE ONLY "Order"
    ADD CONSTRAINT "Order_SID_fkey" FOREIGN KEY ("SID") REFERENCES "Session"("SID");

